import React from 'react'

import FilmRow from "./FilmRow";

const Filmlist = (props) => {
    console.log(props)
    let filmRow = <div class="row">
    {props.films.map(element => 
    <FilmRow title={element.title} id={element.id}/>)}
    </div>
    let img = props.films.map((item,index) => {
        return <img src={item.poster_path}/>
    })

    return (
        <div class="film-list">
        <h1 class="section-title">FILMS</h1>

        {filmRow}

        </div>
    )
}

export default Filmlist
